import React from 'react';


const SearchResults = ({ meals }) => {

    if (!meals) {
        return <h2>No images found!</h2>
    }

return (
    <div className="gallery">
        {meals.map(meal => (
            <div key={meal.strMeal} className="gif">
                <img src={meal.strMealThumb} />
            </div>
        ))}
    </div>
    )
}

export default SearchResults;
